import React from 'react';
import { ReactDOM } from 'react';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render((
  <BrowserRouter>
    <App />
  </BrowserRouter>
), document.getElementById('root'))
